example.code:
MDPartsDatabaseTransaction dbTransaction = database.CreateTransaction();
MDPart part = database.GetPart("myPart");
if (part != null)
{
 part.PartNr = "myNewPart";
 dbTransaction.Commit();
}

member.remarks:
working on parts database items can be done using transactions. When using transactions all changed items will be stored when calling transction.Commit();
using transctions is optional. If no transaction is used the changes will be written to the database on every changing of an MDPartsDatabaseItem object.
When a MDPartsDatabaseItem will be changed on a lot of properties it's recommended to use transactions.

example.code:
MDPartsDatabaseTransaction dbTransaction = database.CreateTransaction();
MDPart part = database.GetPart("myPart");
if (part != null)
{
 part.PartNr = "myNewPart";
 dbTransaction.Commit();
}


